import React from "react";
import { NavLink } from "react-router-dom";

const Footer = () => {
  const data = [
    {
      icon: "fas fa-fire-alt",
      name: "Trending",
      link: "/",
      id: 1,
    },
    {
      icon: "fas fa-film",
      name: "Movies",
      link: "/movies",
      id: 2,
    },
    {
      icon: "fas fa-tv",
      name: "TV Series",
      link: "/tv",
      id: 3,
    },
    {
      icon: "fas fa-search",
      name: "Search",
      link: "/search",
      id: 4,
    },
  ];

  return (
    <div className="w-full bg-gray-900 text-white py-4">
      <div className="flex justify-around flex-wrap">
        {data.map((val) => (
          <NavLink to={val.link} key={val.id}>
            <button className="flex flex-col items-center px-4 py-2 hover:text-yellow-400">
              <i className={`${val.icon} text-xl`}></i>
              <span className="pt-1 text-sm">{val.name}</span>
            </button>
          </NavLink>
        ))}
      </div>
      <div className="text-center mt-4 text-sm text-gray-400">
        takhnat Technologies
      </div>
    </div>
  );
};

export default Footer;
